import React from 'react';
import './TrackLine.scss';

const TrackLine = () => {
  return (
    <div className="track-line-container">
      {/* The actual vertical line */}
      <div className="main-track-line"></div>

      {/* Sector Markers (Papaya Dots) */}
      <div className="sector-marker marker-hero" style={{ top: '15vh' }}></div>
      <div className="sector-marker marker-career" style={{ top: '110vh' }}></div>
      <div className="sector-marker marker-projects" style={{ top: '210vh' }}></div>
      <div className="sector-marker marker-contact" style={{ top: '310vh' }}></div>
    </div>
  );
};

export default TrackLine;
